import React from 'react';

// Import elements
import {
    Banner,
    ArticleWrapper,
    ArticleTitle,
    ArticleBody,
    ArticleSubTitle,
    ArticleQuickLinks,
} from './elements';

const ArticleInner = () => {
    return (
        <>
            <main>

                {/* Banner */}
                <Banner/>

                {/* Article content */}
                <ArticleWrapper>

                    {/* Article title */}
                    <ArticleTitle>
                        Beyco and DOEN Foundation; shared vision on innovation and impact
                    </ArticleTitle>

                    <ArticleBody>

                        {/* Article subtitle */}
                        <ArticleSubTitle>
                            And what we use for our trading platform
                        </ArticleSubTitle>

                        {/* Article quicklinks */}
                        <ArticleQuickLinks>
                            <div>
                                <span>Beyco</span> | Oct 5 | 4 min read
                            </div>
                            <div>
                                <img src={TwitterIcon} />
                            </div>
                        </ArticleQuickLinks>
                    </ArticleBody>
                </ArticleWrapper>
            </main>
        </>
    )
}

export default ArticleInner;
